 used to fulfill your specific request, and to sign you up for our service mailing list, unless you give us permission to use it in other manners.\r\n</p>\r\n\r\n<h2 class=\"ow_smallmargin\">Cookie/Tracking Technology</h2>\r\n \r\n<p class=\"ow_stdmargin\">\r\nThis website may use cookie and tracking technology depending on the features offered. Cookie and tracking technology are useful for gathering information such as browser type and operating system, tracking the number of visitors to the website, and understanding how visitors use the website. Cookies can also help customize the website for visitors. Personal information cannot be collected via cookies and other tracking technology, however, if you previously providedpersonally identifiable information, cookies may be tied to such information. Aggregate cookie and tracking information may be shared with third parties.\r\n</p>\r\n\r\n<h2 class=\"ow_smallmargin\">Distribution of Information</h2>\r\n \r\n<p class=\"ow_stdmargin\">\r\nWe may share information with governmental agencies or other companies assisting us in fraud prevention or investigation. We may do so when: (1) permitted or required by law; or, (2) trying to protect against or prevent actual or potential fraud or unauthorized transactions; or, (3) investigating fraud which has already taken place. The information is not provided to these companies for marketing purposes.\r\n</p>\r\n\r\n<h2 class=\"ow_smallmargin\">Commitment to Data Security</h2>\r\n \r\n<p class=\"ow_stdmargin\">\r\nYour personally identifiable information is kept secure. Only authorized employees, agents and contractors (who have agreed to keep information secure and confidential) have access to this information. All emails and newsletters from this website allow you to opt out of further mailings.\r\n</p>\r\n\r\n<h2 class=\"ow_smallmargin\">Privacy Contact Information</h2>\r\n \r\n<p class=\"ow_stdmargin\">\r\nIf you have any questions, concerns, or comments about our privacy policy you may contact us using means provided on this website. We reserve the right to make changes to this policy. Any changes to this policy will be posted.\r\n</p>'),(69907,1,15947,'test to delete'),(69908,1,15948,'test to delete'),(69909,1,15949,'test to delete'),(69910,1,15950,'test to delete'),(69911,1,15951,'test to delete'),(69912,1,15952,'test to delete'),(69913,1,15953,'test to delete'),(69914,1,15954,'test to delete'),(69915,1,15955,'test to delete'),(69920,1,15960,'test to delete'),(69921,1,15961,'test to delete'),(69922,1,15962,'test to delete'),(69923,1,15963,'test to delete'),(69924,1,15964,'test to delete'),(69925,1,15965,'test to delete'),(69961,1,16001,'Photos of me'),(69960,1,16000,'Add at least 7 photos to your profile'),(69962,1,16002,'View album'),(69963,1,16003,'Upload photos'),(69967,1,16007,'Email Notifications'),(69968,1,16008,'Here you can choose which real time notifications will be delivered by email if you don\'t show up on the site for 2 days.'),(69969,1,16009,'Email Notifications'),(69970,1,16010,'Email Notifications'),(69971,1,16011,'Email Notifications'),(69972,1,16012,'this is unimportant'),(69974,1,16014,'Add category'),(69975,1,16015,'Add new template'),(69976,1,16016,'Virtual Gifts plugin configuration'),(69977,1,16017,'Send gift'),(69978,1,16018,'Virtual Gifts'),(69979,1,16019,'Add'),(69980,1,16020,'Save'),(69981,1,16021,'Send'),(69982,1,16022,'by <a href=\"{$senderUrl}\">{$sender}</a>'),(69983,1,16023,'Gift categories'),(69984,1,16024,'Category'),(69985,1,16025,'Gift category has been added'),(69986,1,16026,'Category has been deleted'),(69987,1,16027,'Category list'),(69988,1,16028,'Please delete this category gifts first'),(69989,1,16029,'Category title:'),(69990,1,16030,'Choose friends'),(69991,1,16031,'Gifts count'),(69992,1,16032,'Are you sure you want to remove ALL user gifts?'),(69993,1,16033,'Are you sure you want to delete this gift template?'),(69994,1,16034,'Delete content and uninstall plugin'),(69995,1,16035,'Before 