ообщества. Вот дружеское напоминание о том, что ваш {$membership} тип участия истекает через 24 часа, будет здорово если вы проверите удобный для вас способ оплаты, чтобы быть с нами.</p>\n<p>Если у вас не настроена периодическая оплата, вы можете дегко ее настроить для обеспечения постоянного и непрерывного премиум доступа, предоставляемого{$membership} типом участия.</p>\n<p>Если у вас есть вопросы  - обращайтесь, мы рады помочь!</p>\n<p>С уважением,<br />\nкоманда{$site_name}</p>'),(79605,32,18899,'Ваш тип участия истекает через 24 часа'),(79606,32,18900,'Здравствуйте{$name},\n\nНадеемся вам нравится быть частью нашего сообщества. Вот дружеское напоминание о том, что ваш {$membership} тип участия истекает через 24 часа, будет здорово если вы проверите удобный для вас способ оплаты, чтобы быть с нами.\n\nЕсли у вас не настроена периодическая оплата, вы можете дегко ее настроить для обеспечения постоянного и непрерывного премиум доступа, предоставляемого {$membership} типом участия.\n\nЕсли у вас есть вопросы  - обращайтесь, мы рады помочь!\n\nС уважением,\nкоманда{$site_name}'),(79607,32,18901,'<p>Здравствуйте {$name},</p>\n<p>Спасибо за продление типа участия! Мы надеемся вы наслаждаетесь привилегиями вашего нового типа участия на нашем сайте, который продлится до{$expirationDate}. Пожалуйста, обращайтесь к нам если у вас есть вопросы, мы всегда готовы вам помочь.</p>\n<p>С уважением,<br />\nкоманда{$site_name}</p>'),(79608,32,18902,'Успешное продление {$membership} типа участия'),(79609,32,18903,'Здравствуйте {$name},\n\nСпасибо за продление типа участия! Мы надеемся вы наслаждаетесь привилегиями вашего нового типа участия на нашем сайте, который продлится до{$expirationDate}. Пожалуйста, обращайтесь к нам если у вас есть вопросы, мы всегда готовы вам помочь.\n\nС уважением,\nкоманда{$site_name}'),(79610,32,18904,'<p>Здравствуйте {$name},</p>\n<p>Ваш {$membership} тип участия обновлен, так как у вас есть периодический {$membership} тип участия настроен на нашем сайте. Спасибо за ваше участие в нашем сообществе!</p>\n<p>И конечно, если у вас есть идеи, вопросы/пожелания, просто сообщите нам!</p>\n<p>С уважением,</br />\nкоманда {$site_name}</p>'),(79611,32,18905,'Ваш тип участия возобновлен'),(79612,32,18906,'Здравствуйте{$name},\n\nВаш {$membership} тип участия обновлен, так как у вас есть периодический {$membership} тип участия настроен на нашем сайте. Спасибо за ваше участиев нашем сообществе!\nИ конечно, если у вас есть идеи, вопросы/пожелания, просто сообщите нам!\nС уважением,\nкоманда{$site_name}'),(79613,32,19781,'{$period} {$periodUnits} - {$price} {$currency}'),(79614,32,19773,'{$price} {$currency} за {$period} {$periodUnits} (повторяющееся)'),(79615,32,19774,'{$period} {$periodUnits} пробного типа участия'),(79616,32,15380,'<a href=\"{$url}\">Платный тип участия</a> плагин должен быть настроен для корректной работы. <br />Вам нужно создать минимум один тип участия с минимум одним планом.'),(79617,32,15381,'Цена'),(79618,32,18466,'ID продукта'),(79619,32,15382,'Периодический'),(79620,32,18907,'Напомнить пользователям по почте о том, что их тип участия истекает через'),(79621,32,18467,'Выбрать роль'),(79622,32,15383,'Роль пользователя для данного типа участия'),(79623,32,18468,'Установить'),(79624,32,18908,'Настройки изменены'),(79625,32,18469,'Установить тип участия:'),(79626,32,18470,'Установить период:'),(79627,32,15384,'Показывать на странице подписки'),(79628,32,15385,'Подписка'),(79629,32,15386,'Подписка'),(79630,32,18471,'Пробный'),(79631,32,19775,'Вы получили {$period} {$periodUnits} пробного типа участия'),(79632,32,18473,'Пробный тип участия может использоваться только один раз'),(79633,32,15387,'Тип участия удален'),(79634,32,15388,'Список типов участия'),(79635,32,15389,'Вы действительно хотите удалить выбранные типы участия?'),(79636,32,15390,'Информация о типе участия'),(79637,32,15391,'Тип участия удален'),(79638,32,15539,'Подписаться'),(79639,32,18474,'Тип участия изменен'),(79640,32,15540,'Ваш тип 