. <br />\n			<b>\"some words\"</b> - Find rows that contain the exact phrase “some words” (for example, rows that contain “some words of wisdom” but not “some noise words”). Note that the “\"” characters that enclose the phrase are operator characters that delimit the phrase. They are not the quotation marks that enclose the search string itself.'),(80612,1,20626,'Back to forum'),(80613,1,20627,'Forum'),(80614,1,20628,'Section'),(80615,1,20629,'Forum'),(80616,1,20630,'attached files'),(80617,1,20631,'Post attachment'),(80618,1,20632,'Clear all'),(80619,1,20633,'Add files'),(80620,1,20634,'Write reply...'),(80621,1,20635,'Unsubscribe'),(80622,1,20636,'Topic'),(80623,1,20637,'Do you really want to subscribe to this topic?'),(80624,1,20638,'Do you really want to unsubscribe to this topic?'),(80625,1,20639,'View quote'),(80626,1,20640,'Are you sure you want to delete these files?'),(80627,1,20641,'Search results'),(80628,1,20642,'Basic'),(80629,1,20643,'message(s) on forum'),(80630,1,20644,'Are you sure you want to delete this quote?'),(80631,1,20645,'Back to post'),(80632,1,20646,'Forum'),(80633,1,20647,'Forum'),(80634,1,20648,'Forum Homepage'),(80635,1,20649,'Forum | {$site_name}'),(80636,1,20650,'Welcome to the discussion forum at {$site_name}. Create new posts, read what others have to say, and join the conversation.'),(80637,1,20651,''),(80638,1,20652,'Forum Advanced Search Page'),(80639,1,20653,'Advanced search {$site_name} Forum'),(80640,1,20654,'Use advanced search to find information you need within {$site_name} forum.'),(80641,1,20655,''),(80642,1,20656,'Forum Advanced Search Results Page'),(80643,1,20657,'Search results for {$site_name} Forum'),(80644,1,20658,'View the results of your forum search on {$site_name}.'),(80645,1,20659,''),(80646,1,20660,'Separate Sub-forum Page'),(80647,1,20661,'{$section_name} at {$site_name} Forum'),(80648,1,20662,'{$section_name}'),(80649,1,20663,''),(80650,1,20664,'Separate Sub-forum Category Page'),(80651,1,20665,'{$group_na