bsite. The term \'user\' refers to the website visitor.\r\n        </p>\r\n        <p>\r\n        The use of this website is subject to the following terms of use:\r\n        </p>\r\n        <ul>\r\n        <li>\r\n        The content of the pages of this website is for user’s general information and use only. It is subject to change without notice.\r\n        </li>\r\n        <li>\r\n        User acknowledges that neither we nor any third parties provide any warranties while the user is using this website for any particular purpose. We expressly exclude liability for any possible harm to the fullest extent permitted by law.\r\n        </li>\r\n        <li>\r\n        User’s use of any information or materials on this website is entirely at their own risk, for which we shall not be liable. It shall be user’s own responsibility to ensure that any products, services or information available through this website meet user’s specific requirements.\r\n        </li>\r\n        <li>\r\n        This website contains material that may be owned by or licensed to us. This material includes, but is not limited to the design, layout, look, appearance and graphics. Reproduction is prohibited other than upon receiving explicit permission.\r\n        </li>\r\n        <li>\r\n        Unauthorised use of this website may give rise to a claim for damages and/or be a criminal offence.\r\n        </li>\r\n        <li>\r\n        This website may also include links to other websites. These links are provided for user’s convenience to provide further information. They do not signify that we endorse said website(s). We have no responsibility for the content of the linked website(s).\r\n        </li>\r\n        <li>\r\n        User agrees not to submit illegal content to this website, and agree to warn website owners after seeing other users doing it.\r\n        </li>\r\n        </ul>'),(82036,1,22050,'Terms of use'),(82037,1,22051,'Terms of use'),(82038,1,22052,'Privacy Policy'),(82039,1,22053,'<p>\n        Thank you for visiting our website. This privacy policy tells you how we use personal information collected at this website. Please read this privacy policy before using the website or submitting any personal information. By using this website, you are accepting the practices described in this privacy policy. These practices may be changed, but any changes will be posted and will only apply to activities and information on a going forward, not retroactive basis. You are encouraged to review the privacy policy whenever you visit the site to keep track of the policy changes and make sure that you understand howany personal information you provide will be used.\n        </p>\n        <p>\n        Note: the privacy practices set forth in this privacy policy are for this website only. If you link to other websites, please review the privacy policies posted at those websites.\n        </p>\n\n        <h2\">Collection of Information</h2>\n\n        <p class=\"ow_stdmargin\">\n        We collect personally identifiable information, like names, email addresses, etc., when voluntarily submitted by our visitors. This information is only used to fulfill your specific request, and to sign you up for our service mailing list, unless you give us permission to use it in other manners.\n        </p>\n\n        <h2>Cookie/Tracking Technology</h2>\n\n        <p>\n        This website may use cookie and tracking technology depending on the features offered. Cookie and tracking technology are useful for gathering information such as browser type and operating system, tracking the number of visitors to the website, and understanding how visitors use the website. Cookies can also help customize the website for visitors. Personal information cannotbe collected via cookies and other tracking technology, however, if you previously providedpersonally identifiable information, cookies may be tied to such information. Aggregate cookie and tracking information may be shared with third parties.\n        </p>\n\n        <h2>Distribution of Information</h2>\n\n        <p>\n        We may share information with governmental agencies or other companies assisting us in fraud prevention or investigation. We may do so when: (1) permitted or required by law; or, (2) trying to protect against or prevent actual or potential fraud or unauthorized transactions; or, (3) investigating fraud which has already taken place. The information is not provided to these companies for marketing purposes.\n        </p>\n\n        <h2>Commitment to Data Security</h2>\n\n        <p>\n        Your personally identifiable information is kept secure. Only authorized employees, agents and contractors (who have agreed to keep information secure and confidential) have access to this information. All emails and newsletters from this website allow you to opt out of further mailings.\n        </p>\n\n        <h2>Privacy Contact Information</h2>\n\n        <p>\n        If you have any questions, concerns, or comments about our privacy policy you may contact us using means provided on this website. We reserve the right to make changes to this policy. Any changes to this policy will be posted.\n        </p>'),(82040,1,22054,'Wrong URL format'),(82041,1,22055,'Choose location'),(82042,1,22056,'City/Town/Zip'),(82043,1,22057,'Search'),(82044,1,22058,'Looking For:'),(82045,1,22059,'Sun, Mon, Tue, Wed, Thu, Fri, Sat'),(82046,1,22060,'Sunday, Monday, Tuesday, Wednesday Thursday, Friday, Saturday'),(82047,1,22061,'Jan, Feb, Mar, Apr, May, Jun, Jul, Aug, Sep, Oct, Nov, Dec'),(82048,1,22062,'January, February, March, April, May, June, July, August, September, October, November, December'),(82049,1,22063,'Choose date'),(82050,1,22064,'Done'),(82051,1,22065,'String is too long'),(82052,1,22066,'String is too short'),(82053,1,22067,'Password should have more than {{length}} characters'),(82054,1,22068,'Password should have less than {{length}} characters'),(82055,1,22069,'Cancel'),(82056