INSERT INTO `ow_base_plugin` VALUES (1,'Base OW plugin','Description','base','base','',1,1,NULL,NULL,1,0,NULL,NULL),(3,'Admin Panel','Admin Panel','admin','admin','',1,1,NULL,NULL,1,0,NULL,NULL),(804,'Advertisement','Simple banner ad management with geo-targeting','advertisement','ads','e547ebcf734341ec11911209d93a1054',0,0,'ads.admin_settings_index',NULL,10800,0,NULL,NULL),(800,'SkaDate System Tools','This is the backend service plugin for SkaDate. Do not deactivate or uninstall. This plugin must only be used for licensed SkaDate websites.','skadate','skadate','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'skadate.settigns','skadate.uninstall',11050,0,NULL,NULL),(812,'Hot List','Allows users to buy a place in the hot list with credits. This plugin must only to be used on licensed SkaDate websites.','hotlist','hotlist','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'hotlist-admin-settings',NULL,10803,0,NULL,NULL),(387,'User Credits','Allow users to earn, purchase and spend user credits','user_credits','usercredits','99d6bdd5bb6468beaf118c4664dd92ff',0,0,'usercredits.admin',NULL,10800,0,NULL,NULL),(856,'PayPal Billing','Accept payments from users with PayPal payment provider','billing_paypal','billingpaypal','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'billing_paypal_admin',NULL,11000,0,NULL,NULL),(388,'Who Viewed Me','Displays guests visited user profile','ocs_guests','ocsguests','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'ocsguests.admin',NULL,9625,0,NULL,NULL),(381,'Paid Membership','Customizable paid membership levels for accepting membership subscriptions','membership','membership','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'membership_admin',NULL,10808,0,NULL,NULL),(382,'Photo','Allow users to upload photos with tags, rates, and comments','photo','photo','e547ebcf734341ec11911209d93a1054',0,1,'photo_admin_config','photo_uninstall',10800,0,NULL,NULL),(838,'Location Maps','This plugin allows users to add their Google Maps or Bing Maps location in profile details.\n        Plugin compatible with Oxwall 1.7.3 and upper','google_map_location','googlelocation','8697bdc9467df91a82092e3f1ffd199f',0,1,'googlelocation_admin',NULL,123,0,NULL,NULL),(376,'User Search','Implements quick and advanced search interfaces for dating sites. This plugin must only be used on licensed SkaDate websites.','usearch','usearch','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'usearch.admin_general_setting',NULL,10803,0,NULL,NULL),(852,'Messages','Unified messaging plugin for private on-site communication','mailbox','mailbox','e547ebcf734341ec11911209d93a1054',0,1,NULL,NULL,10850,0,NULL,NULL),(810,'Matchmaking','Allows to calculate compatibility score between users based on profile information. You can modify the rules to change the matching algorithm. This plugin must only be used on licensed SkaDate websites.','matchmaking','matchmaking','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'matchmaking_admin_rules','matchmaking_uninstall',10818,0,NULL,NULL),(824,'Activity notifications','Real-time and email notifications about site activity','notifications','notifications','e547ebcf734341ec11911209d93a1054',0,1,NULL,NULL,8710,0,NULL,NULL),(825,'Virtual Gifts','Allow users to send private and public virtual gifts','virtual_gifts','virtualgifts','e547ebcf734341ec11911209d93a1054',0,1,'virtual_gifts_templates','virtual_gifts_uninstall',10800,0,NULL,NULL),(826,'Profile Cover Gallery','Shows a beautiful photo gallery on user profile. This plugin must only be used on licensed SkaDate websites.','pcgallery','pcgallery','99d6bdd5bb6468beaf118c4664dd92ff',0,1,NULL,NULL,10808,0,NULL,NULL),(827,'Bookmarks','Allow users to bookmark profiles for further contact. Help them never miss their match.','bookmarks','bookmarks','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'bookmarks.admin',NULL,10800,0,NULL,NULL),(828,'Winks','Allow users to wink at each other to increase the number of contacts for monetization.','winks','winks','99d6bdd5bb6468beaf118c4664dd92ff',0,1,NULL,NULL,10800,1,NULL,NULL),(829,'Google Analytics','Track your site visitor statistics with Google Analytics','google_analytics','ganalytics','e547ebcf734341ec11911209d93a1054',0,0,'ganalytics_admin',NULL,8710,0,NULL,NULL),(830,'Contact Us','\"Contact us\" page with the ability to choose departments (email addresses)','contactus','contactus','e547ebcf734341ec11911209d93a1054',0,1,'contactus.admin',NULL,10800,0,NULL,NULL),(833,'Premoderation','Moderation tools','premoderation','moderation','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'moderation.admin',NULL,10800,0,NULL,NULL),(862,'SkaDate Mobile Application','iOS and Android App Settings','skmobileapp','skmobileapp','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'skmobileapp_admin_ads',NULL,11,0,NULL,NULL),(835,'CCBill Billing','Accept payments from users with CCBill payment provider','billing_ccbill','billingccbill','99d6bdd5bb6468beaf118c4664dd92ff',0,0,'billing_ccbill_admin',NULL,10800,0,NULL,NULL),(836,'Private photo albums','The plugin allows site users to lock their photo albums, making them private and available only to friends or users with designated photo album passwords.','protectedphotos','protectedphotos','99d6bdd5bb6468beaf118c4664dd92ff',0,1,NULL,NULL,10800,0,NULL,NULL),(839,'Blogs','User blogs with archives, tags, comments and rates','blogs','blogs','e547ebcf734341ec11911209d93a1054',0,1,'blogs-admin','blogs-uninstall',10800,0,NULL,NULL),(861,'Firebase auth','Site logins using google, twitter and facebook.','firebase_auth','firebaseauth','99d6bdd5bb6468beaf118c4664dd92ff',0,1,'firebaseauth_admin_index',NULL,1,0,NULL,NULL),(841,'Events','Create public and private events within your community, let people RSVP and discuss','event','event','e547ebcf734341ec11911209d93a1054',0,1,NULL,NULL,10800,0,NULL,NULL),(842,'Forum','Simple discussion boards for users','forum','forum','e547ebcf734341ec11911209d93a1054',0,1,'forum_admin_config','forum_uninstall',10800,0,NULL,NULL),(843,'Friends','Friending functionality to be used across multiple features','friends','friends','e547ebcf73